import axios from 'axios';

export const getStripe = async(cartTotal, cartProducts) => {
  let response;
  try {
   response = await axios.get('/shop/checkout', {cartTotal, cartProducts});
  } catch (e) {
    return e
  }
  console.log(response);
  return response.data;
}
